import EditProduct from './components/EditProduct.js';

function App() {
  return (
    <Router>
      
      <div className="App">
        <h1>Inventory System</h1>
        <Routes>
  <Route path="/" element={<Home />} />
  <Route path="/about" element={<About />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
